window.bookSummaryJSON = "<p><b>The first three rip-roaring Aussie Mana Apocalypse books are packaged here (contains books one to three).</b></p> <p><b>The world ended, and the Gap Year Six were born.</b></p> <p>When the apocalypse hits, a ragtag team of Aussie teens are the world's only hope to stop an alien invasion. Their only chance? The new RPG-like rules that now govern reality.</p> <p>The world's now a game.</p> <p>And there's no reset button.</p> <p><b>Features</b></p> <p><b>1: </b><b><i>The Aussie Mana Apocalypse</i></b></p> <p><b>2: </b><b><i>Fair Dinkum Dungeon Diving</i></b></p> <p><b>3: </b><b><i>Conviction</i></b></p> <p>You'll love this tale of mateship, coming of age, and good old-fashioned dungeoneering.</p> <p>Get it now.</p>"; 
